import GlobalStyle from "./styles";
import Routes from "./routes/";
import { ToastContainer } from "react-toastify";

function App() {
  return (
    <div className="App">
      <GlobalStyle />
      <Routes />
      <ToastContainer />
    </div>
  );
}

export default App;
